    <g ed:layout="rightmap" id="542" ed:width="517" ed:height="114" ed:parentid="261" transform="matrix(1,0,0,1,2655,1496)">
        <path stroke-linejoin="round" fill="none" stroke="#454545" d="M4,0L513,0C515.7,0,517,1.3,517,4L517,110C517,112.7,515.7,114,513,114L4,114C1.3,114,0,112.7,0,110L0,4C0,1.3,1.3,0,4,0z"/>
        <text class="st6">
            <tspan x="9" y="15.8" style="white-space:pre">is set if the Serializable class writing the stream had a `writeObject` method </tspan>
            <tspan x="9" y="33.8" style="white-space:pre">that may have written additional data to the stream. In this case a </tspan>
            <tspan x="9" y="51.8" style="white-space:pre">*TC_ENDBLOCKDATA* marker is always expected to terminate the data for </tspan>
            <tspan x="9" y="69.8" style="white-space:pre">that class.</tspan>
            <tspan x="9" y="105.8" style="white-space:pre">如果有 writeObject 就设这个</tspan>
        </text>
    </g>
    <g ed:layout="rightmap" id="544" ed:width="517" ed:height="78" ed:parentid="263" transform="matrix(1,0,0,1,2657,1617)">
        <path stroke-linejoin="round" fill="none" stroke="#454545" d="M4,0L513,0C515.7,0,517,1.3,517,4L517,74C517,76.7,515.7,78,513,78L4,78C1.3,78,0,76.7,0,74L0,4C0,1.3,1.3,0,4,0z"/>
        <text class="st6">
            <tspan x="9" y="15.8" style="white-space:pre">is set if the `Externalizable` class is written into the stream using </tspan>
            <tspan x="9" y="33.8" style="white-space:pre">`STREAM_PROTOCOL_2`. By default, this is the protocol used to write </tspan>
            <tspan x="9" y="51.8" style="white-space:pre">`Externalizable` objects into the stream in JDK 1.2. JDK 1.1 writes </tspan>
            <tspan x="9" y="69.8" style="white-space:pre">*STREAM_PROTOCOL_1*.</tspan>
        </text>
    </g>
    <g ed:layout="rightmap" id="546" ed:width="517" ed:height="96" ed:parentid="265" transform="matrix(1,0,0,1,2499,1701)">
        <path stroke-linejoin="round" fill="none" stroke="#454545" d="M4,0L513,0C515.7,0,517,1.3,517,4L517,92C517,94.7,515.7,96,513,96L4,96C1.3,96,0,94.7,0,92L0,4C0,1.3,1.3,0,4,0z"/>
        <text class="st6">
            <tspan x="9" y="15.8" style="white-space:pre">is set if the class that wrote the stream extended `java.io.Serializable` but not </tspan>
            <tspan x="9" y="33.8" style="white-space:pre">`java.io.Externalizable`, the class reading the stream must also extend </tspan>
            <tspan x="9" y="51.8" style="white-space:pre">`java.io.Serializable` and the default serialization mechanism is to be used.</tspan>
            <tspan x="9" y="87.8" style="white-space:pre">继承了  `java.io.Serializable`  但是没有继承 `java.io.Externalizable` </tspan>
        </text>
    </g>
    <g ed:layout="rightmap" id="548" ed:width="517" ed:height="96" ed:parentid="267" transform="matrix(1,0,0,1,2521,1804)">
        <path stroke-linejoin="round" fill="none" stroke="#454545" d="M4,0L513,0C515.7,0,517,1.3,517,4L517,92C517,94.7,515.7,96,513,96L4,96C1.3,96,0,94.7,0,92L0,4C0,1.3,1.3,0,4,0z"/>
        <text class="st5">
            <tspan x="9" y="15.8" style="white-space:pre">is set if the class that wrote the stream extended `java.io.Externalizable`, the </tspan>
            <tspan x="9" y="33.8" style="white-space:pre">class reading the data must also extend `Externalizable` and the data will be </tspan>
            <tspan x="9" y="51.8" style="white-space:pre">read using its `writeExternal` and `readExternal` methods.</tspan>
            <tspan x="9" y="87.8" style="white-space:pre">继承了  `java.io.Externalizable` </tspan>
        </text>
    </g>
    <g ed:layout="rightmap" id="550" ed:width="517" ed:height="132" ed:parentid="269" transform="matrix(1,0,0,1,2453,1906)">
        <path stroke-linejoin="round" fill="none" stroke="#454545" d="M4,0L513,0C515.7,0,517,1.3,517,4L517,128C517,130.7,515.7,132,513,132L4,132C1.3,132,0,130.7,0,128L0,4C0,1.3,1.3,0,4,0z"/>
        <text class="st5">
            <tspan x="9" y="15.8" style="white-space:pre">is set if the class that wrote the stream was an enum type. The receiver's </tspan>
            <tspan x="9" y="33.8" style="white-space:pre">corresponding class must also be an enum type. Data for constants of the </tspan>
            <tspan x="9" y="51.8" style="white-space:pre">enum type will be written and read as described in [Section 1.12, </tspan>
            <tspan x="9" y="69.8" style="white-space:pre">"Serialization of Enum Constants](https://docs.oracle.com/javase/8/docs/</tspan>
            <tspan x="9" y="87.8" style="white-space:pre">platform/serialization/spec/serial-arch.html#a6469)".</tspan>
            <tspan x="9" y="123.8" style="white-space:pre">如果是 enum 就设置</tspan>
        </text>
    </g>
